INSERT INTO `khowledge_items` VALUES (23, 4, 'สวนสละ', 'สวนสละ เกษตรผสมผสาน สามารถจัดกิจกรรมเรียนรู้ แข่งขันกิน ปอกสละ อย่างถูกวิธี ค่าใช้จ่ายในการจัดกิจกรรมคิดเป็นรายบุคคล คนละ 80 บาท', 'knowledge-23.jpg');
INSERT INTO `khowledge_items` VALUES (24, 7, 'เห็ดทอดนาโหนด', 'ฟาร์มเห็ด และผลิตภัณฑ์เห็ดทอด ', 'knowledge-24.jpg');
INSERT INTO `khowledge_items` VALUES (25, 8, 'สถาบันการเงินชุมชน', 'สถาบันการเงินชุมชน องค์กรหมู่บ้าน สถาบันเกษตรกร', 'knowledge-25.JPG');
INSERT INTO `khowledge_items` VALUES (26, 9, 'วิสาหกิจชุมชน', 'เป็นวิสาหกิจชุมชนเข้มแข็ง รวบรวมผลผลิตของเกษตรกร ให้บริการด้านการเงิน สินเชื่อแก่สมาชิกในกลุ่ม', 'knowledge-26.jpg');
