INSERT INTO `khowledge_items_bak` VALUES (14, 12, 'ศูนย์การเรียนรู้เศรษฐกิจพอเพียง', 'ตลาดแนวใหม่ อนุรักษ์ธรรมชาติ ที่เพิ่งเปิดเมื่อต้นปีนี้เอง ในส่วน ของตลาดจะเป็นธรรมชาติแบบสุดๆโอบล้อมไปด้วยต้นไผ่และมีพื้นที่ ที่กว้างขวางกว่า 30', 'knowledge-14.jpg');
