INSERT INTO `schedule_plan` VALUES (2, 22, '<h3 class=\"text-center text-blue thai-font\">กำหนดการเดินทางศึกษาภาคสนาม<br>จากคณะทรัพยากรธรรมชาติ มหาวิทยาลัยสงขลานครินทร์ ไปยัง จ.กระบี่ เริ่มเดินทางระหว่างวันที่ 11 ธ.ค. 2561 ถึง 12 ธ.ค. 2561 เป็นเวลา 2 วัน</h3><h3 class=\"thai-font text-green text-center\">กำหนดการเดินทางของวันที่ 11 ธ.ค. 2561</h3><table class=\"table\"><tbody><tr style=\"font-size:16px;\"><td class=\"text-center\"><p>08:00<br>08:39</p></td><td><p>จากคณะทรัพยากรธรรมชาติ อ.หาดใหญ่ จ.สงขลา<br>ถึงสถาบันการเงินชุมชน ตำบลกำแพงเพชร อ.รัตภูมิ จ.สงขลา<br>การติดต่อ: คุณอิสมาแอ สามารถ (ประธานกลุ่ม) โทรศัพท์: 084-8546015</p></td></tr><tr style=\"font-size:16px;\"><td class=\"text-center\"><p>09:39<br>10:30</p></td><td><p>จากสถาบันการเงินชุมชน ตำบลกำแพงเพชร อ.รัตภูมิ จ.สงขลา<br>ถึงกลุ่มเกษตรกรทำนาตะโหมด อ.ตะโหมด จ.พัทลุง<br>การติดต่อ: คุณอรุณ ไพชำนาญ (ประธานกลุ่ม) โทรศัพท์: 089-7372634</p></td></tr><tr style=\"font-size:16px;\"><td class=\"text-center\"><p>11:30<br>11:54</p></td><td><p>จากกลุ่มเกษตรกรทำนาตะโหมด อ.ตะโหมด จ.พัทลุง<br>ถึงฟาร์มเห็ดแหลมทองนาโหนด อ.เมืองพัทลุง จ.พัทลุง<br>การติดต่อ: คุณชัยยงค์ คชพันธ์ (เจ้าของกิจการ) โทรศัพท์: 089-8702332</p></td></tr><tr style=\"font-size:16px;\"><td class=\"text-center\"><p>1 ชั่วโมง</p></td><td>--พักกลางวัน--</td></tr><tr style=\"font-size:16px;\"><td class=\"text-center\"><p>13:54<br>14:17</p></td><td><p>จากฟาร์มเห็ดแหลมทองนาโหนด อ.เมืองพัทลุง จ.พัทลุง<br>ถึงสวนสละ นายนัน ชูเอียด อ.ป่าบอน จ.พัทลุง<br>การติดต่อ: คุณนัน ชูเอียด (เจ้าของกิจการ) โทรศัพท์: 087-8377042</p></td></tr><tr style=\"font-size:16px;\"><td class=\"text-center\"><p>15:17<br>15:41</p></td><td><p>จากสวนสละ นายนัน ชูเอียด อ.ป่าบอน จ.พัทลุง<br>ถึงวิสาหกิจชุมชน (กล้วยฉาบ) อ.ศรีนครินทร์ จ.พัทลุง<br>การติดต่อ: ประทิ่น นาคมิตร (ประธานกลุ่ม) โทรศัพท์: 086-2921923, 074-605659</p></td></tr><tr style=\"font-size:16px;\"><td class=\"text-center\"><p>16:41<br>17:23</p></td><td><p>จากวิสาหกิจชุมชน (กล้วยฉาบ) อ.ศรีนครินทร์ จ.พัทลุง<br>ถึงศูนย์พัฒนาที่ดินจังหวัดต